import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
export default class Footer extends Component {
    render() {
        return (
            <Router>
            <div className="container-fluid bg-dark">
                <div className="row">
                <Link  className="links col-2" to="/">Home</Link>
                <Link className="links col-2"  to="/">Find Car</Link>
                <Link className="links col-2"  to="/">Rent Car</Link>
                <Link className="links col-2"  to="/">Channels</Link>
                <Link className="links col-2"  to="/">Dealer</Link>
                <Link  className="links col-2" to="/">Machanic Shop</Link>
                </div>
            </div>
            </Router>
        )
    }
}
